import React, { memo } from 'react'
import { FilterWrapper } from './style'

const EntireFilter = memo((props) => {
  return (
    <FilterWrapper>
      {
        filterData.map((item, index) => {
          return (
            <div className='item' key={item}>{item}</div>
          )
        })
      }
    </FilterWrapper>
  )
})

export default EntireFilter
